#solution for Question 6

def information_security():
    #Initialize the two given statements about Marcus and Olivia Brown 
    mr_statement = "The individual stated that the company promotes fair treatment of its workers. The individual is motivated by their ability to destroy the company. The individual's top priority is following the organization's security protocols."
    olivia_statement = "Achieving the organization's security procedures is crucial to personal success. The individual has the power to safeguard themselves from potential data breaches. The speaker desires to safeguard the knowledge and technical assets of their company. Precautionary actions do not guarantee the safety of computer data."
    #split each statement into a list of words
    mr_words = mr_statement.split()
    olivia_words = olivia_statement.split()
    #create variables to store the number of times the word 'security' appears in each statement and the number of times the word 'compliance' appears in each statement
    mr_security_count = 0
    olivia_security_count = 0
    mr_compliance_count = 0
    olivia_compliance_count = 0
    #for each word in the statements, if it is 'security', increment the security count for that statement and vice versa
    for word in mr_words:
        if word == "security":
            mr_security_count += 1
    for word in olivia_words:
        if word == "security":
            olivia_security_count += 1
    #for each word in the statements, if it is 'compliance', increment the compliance count for that statement and vice versa
    for word in mr_words:
        if word == "compliance":
            mr_compliance_count += 1
    for word in olivia_words:
        if word == "compliance":
            olivia_compliance_count += 1
    #check which statement has a higher security count and a lower compliance count
    if mr_security_count > 0 and mr_compliance_count < olivia_compliance_count:
        return "Marcus Brown"
    else:
        return "Olivia Brown"
