import string

# function to clean text by removing punctuation and converting to lowercase
def clean_text(text):
    # create a translation table to remove punctuation
    table = str.maketrans('', '', string.punctuation)
    return text.translate(table).lower()

# function to count the frequency of each word in a sentence
def get_word_frequency(sentence):
    words = clean_text(sentence).split() # split into words and remove punctuation and lowercase
    word_counts = {}
    for word in words:
        if word not in word_counts:
            word_counts[word] = 1 # initialize count to 0
        else:
            word_counts[word] += 1 # increment count by 1
    return word_counts

